import schedule
import time
import pystray
from PIL import Image
import io
import base64
import os
import sys
from datetime import datetime
import tempfile
import threading
import pygame
from win10toast import ToastNotifier

# === Base64 Icon (.ico) ===
icon_base64 = """

"""

# === Base64 MP3 (DR.mp3) ===
mp3_base64 = """

"""


# === Decode icon and return image ===
def get_icon_image():
    icon_data = base64.b64decode(icon_base64)
    image = Image.open(io.BytesIO(icon_data))
    return image

# === Save icon to a temp .ico file ===
def save_temp_icon():
    temp_icon_path = os.path.join(tempfile.gettempdir(), "temp_drink_water.ico")
    image = get_icon_image()
    image.save(temp_icon_path, format='ICO')
    return temp_icon_path

# === Play embedded MP3 notification sound using pygame ===
def play_embedded_mp3():
    temp_mp3_path = os.path.join(tempfile.gettempdir(), "temp_dr.mp3")

    # Save mp3 to temp file
    with open(temp_mp3_path, "wb") as f:
        f.write(base64.b64decode(mp3_base64))

    # Function to play using pygame
    def play():
        try:
            pygame.mixer.init()
            pygame.mixer.music.load(temp_mp3_path)
            pygame.mixer.music.play()
            while pygame.mixer.music.get_busy():
                time.sleep(0.1)
        except Exception as e:
            print("Error playing sound:", e)

    threading.Thread(target=play, daemon=True).start()

# === Initialize toast notifier
notifier = ToastNotifier()

# === Send notification with sound ===
def drink_water_reminder():
    current_time = datetime.now().strftime("%I:%M %p")
    play_embedded_mp3()
    notifier.show_toast(
        "Drink Water Reminder",
        f"It's {current_time} - Time to drink water!",
        duration=10,
        threaded=True,
        icon_path=save_temp_icon()
    )

# === Schedule hourly reminders from 10 AM to 7 PM ===
def schedule_reminders():
    for hour in range(10, 20):
        schedule.every().day.at(f"{hour:02d}:00").do(drink_water_reminder)

# === Handle tray menu clicks ===
def on_right_click(icon, item):
    if item.text == "End Task":
        icon.stop()
        os._exit(0)
    elif item.text == "Show Notification":
        drink_water_reminder()

# === Create system tray icon ===
def create_system_tray_icon():
    image = get_icon_image()
    menu = pystray.Menu(
        pystray.MenuItem("End Task", on_right_click),
        pystray.MenuItem("Show Notification", on_right_click),
    )
    icon = pystray.Icon("Water Reminder", image, "Water Reminder", menu=menu)
    return icon

# === Main Entry Point ===
if __name__ == "__main__":
    schedule_reminders()
    print("Water reminder script is running. Keep this window open.")
    print("Press Ctrl+C to stop the script.")

    tray_icon = create_system_tray_icon()
    tray_icon_thread = threading.Thread(target=tray_icon.run)
    tray_icon_thread.daemon = True
    tray_icon_thread.start()

    try:
        while True:
            schedule.run_pending()
            time.sleep(1)
    except KeyboardInterrupt:
        print("\nScript stopped.")
        tray_icon.stop()
